package datastructures;

import java.util.HashSet;
import java.util.Set;

public class Sets {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Set<String> animals = new HashSet<String>();
		
		animals.add("Dog");
		animals.add("Pig");
		animals.add("Hog");
		animals.add("Cat");
		animals.add("Snake");

		System.out.println(animals);
		
		

	}

}
